import React from "react";
import bg from "./faq.png";

const Blogs = () => {
  return (
    <div>
      <div className="text-center">
        <p className="text-primary font-medium">Blogs</p>
        <p className="font-bold text-xl"> Get ready for healhy blogs </p>
      </div>
      <div className="flex">
        <div className=" flex flex-row justfy-center items-center  bg-center bg-cover w-64 h-80 bg-gradient-to-t from-gray-700 to-gray-0  bg-opacity-0  ">
          <div
            className="align-middle  h-full w-full bg-[url(${bg})] "
            style={{
              background: `linear-gradient(
            rgba(0, 0, 0, 0.6),
            rgba(0, 0, 0, 0.6)
          ), url("${bg}") no-repeat center center cover`,
            }}
          ></div>
        </div>
      </div>
    </div>
  );
};

export default Blogs;
